import React from "react";

const Header = ({ title, subtitle }) => {
  return (
    <header className="header-section">
      <h1>{title}</h1>
      <h3>{subtitle}</h3>
    </header>
  );
};

Header.defaultProps = {
  title: "Goal Tracker",
  subtitle: "by Khair Alanam",
};

export default Header;
